import React, { useState } from 'react'

export const Login = () => {

    // Estado para almacenar usuario y contraseña
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');

    // Manejador para el evento de envío del formulario
    const handleSubmit = (event) => {
        event.preventDefault();  // Prevenir el comportamiento de envío por defecto del formulario
        // Aquí puedes añadir la lógica para verificar las credenciales
        console.log('Login submitted with username:', username, 'and password:', password);
    };

    return (
        <form onSubmit={handleSubmit}>
            <div>
                <label htmlFor="username">Usuario:</label>
                <input
                    id="username"
                    type="text"
                    value={username}
                    onChange={e => setUsername(e.target.value)} // Actualiza el estado al cambiar el contenido del input
                />
            </div>
            <div>
                <label htmlFor="password">Contraseña:</label>
                <input
                    id="password"
                    type="password"
                    value={password}
                    onChange={e => setPassword(e.target.value)} // Actualiza el estado al cambiar el contenido del input
                />
            </div>
            <button type="submit">Iniciar sesión</button>
        </form>
    );

}
